private void showTimeWithUserTimezone(boolean showWithTimezone)
{
    ProdJournalRoute_FromTime.visible(!showWithTimezone);
    ProdJournalRoute_ToTime.visible(!showWithTimezone);
    Job.visible(!showWithTimezone);
    ProdJournalRoute_FromTimeString.visible(showWithTimezone);
    ProdJournalRoute_ToTimeString.visible(showWithTimezone);
    JobTimezone.visible(showWithTimezone);
}

void prodJournalRouteForceWrite()
{
    if (prodJournalRoute.RecId && prodJournalRoute.isProjMethodConsumed())
    {
        if ((!prodJournalRouteProjHour.orig().equal(prodJournalRouteProjHour)) ||
            (!prodJournalRouteProjQuantity.orig().equal(prodJournalRouteProjQuantity)))
            prodJournalRoute_ds.write();
    }
}

boolean validate()
{
    boolean ret = true;

    if (prodJournalRoute && prodJournalRoute.isProjMethodConsumed())
    {
        ret = prodJournalRoute_ds.validateWrite();
        ret = ret && prodJournalRouteProjHour_ds.validateWrite();
        ret = ret && prodJournalRouteProjQuantity_ds.validateWrite();

        if (!ret)
            element.design().controlName(identifierstr(Overview)).setFocus();
    }

    return ret;
}

protected void initControls(Integer _journalTypeId)
{
    // <GEERU>
    boolean isProdJournalRelease_RU, visibleProdJournalReleaseCreate_RU;
    // </GEERU>

    autoBackFlushing.visible(false);
    reference.visible(false);

    // <GEERU>
    if (SysCountryRegionCode::isLegalEntityInCountryRegion([#isoRU]))
    {
        isProdJournalRelease_RU             = false;
        visibleProdJournalReleaseCreate_RU  = true;

        pickingListJournal          .visible(!isProdJournalRelease_RU);
        reportedAsFinishedJournal   .visible(!isProdJournalRelease_RU);
        routeCardJobCardJournal     .visible(!isProdJournalRelease_RU);
        prodJournalReleaseCreate_RU .visible(visibleProdJournalReleaseCreate_RU && ProdParametersDim::findDefault().UseReleaseFromProduction_RU);
    }
    // </GEERU>
}

