int active()
{
    int ret;

    ret = super();
    journalFormTrans.datasourceActivePost();
    if (prodJournalRoute.isProjMethodConsumed())
    {
        skipWrite = true;
        prodJournalRouteProjHour_ds.executeQuery();
        prodJournalRouteProjQuantity_ds.executeQuery();
        skipWrite = false;
    }
    element.enableFieldsActive();
    return ret;
}

