{
    FormStringControl formControl = _formControl;
    FormRun formRun;
    Args    args;

    if (prodJournalRoute.isProjMethodConsumed())
    {
        args = new Args(formstr(ProjCategoryLookup));
        args.caller(element);
        args.record(prodJournalRoute_DS.cursor());

        formRun = ClassFactory::formRunClassOnClient(args);
        formRun.init();
        formControl.performFormLookup(formRun);
    }
    else
    {
        super(_formControl, _filterStr);
    }
}

