}

public boolean validate()
{
    boolean ret;

    ret = super();

    if (ret)
    {
        // Work center has to be from the site specified on the production order
        if (ProdTable::find(prodJournalRoute.ProdId).inventDim().InventSiteId != WrkCtrTable::resourceGroup(prodJournalRoute.WrkCtrId, prodJournalRoute.TransDate, prodJournalRoute.TransDate).SiteId)
        {
            ret = checkFailed("@SYS109461");
        }
    }

    return ret;
}

public boolean validate()
{
