    ret = ProdTable::validateWHSLocationLPSetup(ProdJournalRouteProdTable.ItemId, InventDim.wMSLocationId, InventDim.InventLocationId);

    if (ret)
    {
        ret = super();
    }

    return ret;
}

public void initValue()
{
    ProjTable projTable;
    ProdTable prodTable;

    ProjJournalTransMapForm projJournalTransMapForm;
    super();

    prodTable = ProdTable::find(prodJournalRoute.ProdId);
    if (prodTable.isProjMethodConsumed())
    {
        projTable = prodTable.projTable();

        projJournalTransMapForm = ProjJournalTransMapForm::construct(prodJournalRouteProjHour,prodJournalRoute);
        projJournalTransMapForm.initFromProjTable(projTable);

        prodJournalRouteProjHour.ProjId = projTable.ProjId;

        prodJournalRouteProjHour.ActivityNumber = prodTable.ActivityNumber;
    }
}

public void delete()
{
    if (prodJournalRoute.isProjMethodConsumed() && projectHour.isActivePage())
        prodJournalRoute_ds.delete();
}

public void executeQuery()
{
    QueryBuildDataSource  qbds;
    Query                 query;

    query = this.query();
    qbds = query.dataSourceName(this.name());
    qbds.clearRanges();
    qbds.addRange(fieldnum(ProdJournalRouteProj, JournalId)).value(prodJournalRoute.JournalId);
    qbds.addRange(fieldnum(ProdJournalRouteProj, LineNum)).value(queryValue(prodJournalRoute.LineNum));
    qbds.addRange(fieldnum(ProdJournalRouteProj, TransType)).value(queryValue(ProdRouteTransType::Time));

    super();
}

